(87, 'Bite Bug', 1, 5, 3, 1, 3, 'None', 0, 'Standard', 'Bite Bug is an enemy in Final Fantasy VIII. A bug monster that flies, this pesky blue insect is one of the first monster types the player will encounter. They fly around Balamb Island and inflict Poison status with their Needle attack. Although they are easy to overwhelm with physical attacks, stocking up on healing items such as Antidotes and Remedies is advised.\r\n\r\nBite Bugs also provide useful magic, such as Scan and Fire early in the game. ', 1, 0, 1, NULL, 75, 0, 45, NULL),
