(103, 'Bob', 7, 6, 7, 3, 8, 'None', 0, 'Suikoden2', 'Bob is a werewolf from a village of lycanthropes which was destroyed by the sorceress Windy. Bob possesses a rune which allows him to sustain human form. Bob has a strong dislike for humans and would rather disassociate himself from them all together. Bob is found in the Kobald District of Two River City but refuses to join Riou til much later.', 1, 0, 0, NULL, 525, 35, 315, NULL),
