(158, 'Cidolfas Orlandu', 10, 6, 5, 10, 8, 'None', 0, 'FFT', 'Count Cidolfas Orlandu A.K.A \"T.G (Thunder God) Cid\" was the leader of the undefeated Nanten Knights during the 50 Year war in Ivalice. Orlandu was arrested for supposedly plotting a revolt against Duke Goltana but was rescued and saved by his step-son Olan Durai and Ramza Beoulve. Orlandu is an expert swordsman who is rivaled only by the late Balbanes Beoulve.', 3, 0, 0, NULL, 750, 50, 450, NULL),
