(191, 'Dorky Face', 1, 2, 4, 3, 3, 'poison', 0, 'FF7', 'Found in the Shinra Mansion, this frankly terrifying monster would beguile you with its nifty attacks including \"Funny Breath\" and \"Curses\", making the path to unlock Vincent (aswell as the secrets of the shinra mansion) all the more troublesome. While comical in appearance, the status effects incurred from these little critters pack a punch.  Do not take its dorky face too lightly, these guys are no pushovers!', 1, 0, 1, NULL, 75, 5, 45, NULL),
