(636, 'Rei Ayanami', 9, 5, 5, 6, 10, 'None', 0, 'Anime', 'Rei Ayanami is known as the \"First Child\" of the Eva pilots in the series Neon Genesis Evangelion and pilots Evangelion Unit 00. Rei is thought to be a clone of Yui Ikari (Shinji Ikaris deceased mother) due to her physical resemblance to her, although considered not entirely human. Rei has little regard for her life, shown to sometimes sacrifice herself selflessly, as her \"soul\" can be transferred to another clone of herself, which is secretly stored deep below NERV headquarters.', 2, 0, 0, NULL, 675, 45, 405, NULL),
