(642, 'Richmond', 4, 7, 5, 3, 4, 'None', 0, 'Suikoden2', 'Richmond is a Private Investigator from Radat Town. Little is known about Richmond or his past but if the price is right Richmond can find out almost anything about anyone. Richmond can also (for a price) provide information on how to recruit certain people into your forces. Richmond only joined Riou after Riou learned to see through Richmonds cheap coin flipping trick. ', 1, 0, 1, NULL, 300, 20, 180, NULL),
(643, 'Rico', 8, 9, 2, 9, 5, 'None', 0, 'XenoTrigger', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
(644, 'Riddel', 9, 10, 9, 3, 4, 'holy', 0, 'CC', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(645, 'Ridley', 9, 8, 4, 4, 10, 'None', 0, 'Suikoden2', 'General Ridley is the leader of the Kobald District in Two River City and is highly regarded by Kobalds as a great general. When Two River was almost taken by the Highland army but saved by Riou and his strategist Shu Two River agrees to lend a hand to Riou in fighting Highland and Ridley personally joins Riou and plays a large part in defeating Highland and reuniting the City State of Jowston. Ridley also has a son named Boris who is seemingly following his fathers foot steps.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(646, 'Rikimaru', 1, 4, 3, 3, 2, 'None', 0, 'Suikoden2', '', 1, 0, 1, NULL, 75, 5, 45, NULL),
(647, 'Rina', 1, 5, 1, 4, 1, 'fire', 0, 'Suikoden2', 'Rina is a traveling performer who tells peoples fortunes. She is the older sister of Ellie and unlike her sister who is shy Rina is everything but shy. She has been traveling all over the land with Ellie and Bolgan and they joined Riou after he helped them cross a lake during a ship ban by Highland. She is also quite a drinker and she even managed to beat Viktor in a drinking contest.', 1, 0, 1, NULL, 75, 5, 45, NULL),
(648, 'Rinoa', 10, 10, 10, 4, 2, 'None', 0, 'Standard', 'Arguably one of the most sought after cards in Triple Triad Extreme, Rinoa Heartily serves as the primary female character in Final Fantasy 8. \r\n\r\nRinoa is a member of the Forest Owls, a small resistance faction seeking to liberate the small nation of Timber from Galbadian occupation. Rinoa meets Squall after his team helps the forest owls resistance movement fight off Galbadia.\r\n\r\nBecause of Rinoas card power, she tends to fetch a high price in the Triple Triad Extreme Merchant Bazaar. \r\n', 3, 0, 0, NULL, 750, 50, 450, NULL),
(649, 'Riou', 10, 4, 9, 10, 6, 'holy', 0, 'Suikoden2', 'The Adopted son of the famous Genkaku Riou spent his youth in the Highland town of Kyaro. He joined the Unicorn Youth Brigade along with his childhood friend Jowy but, once the brigade was slaughtered and made to look like an attack by the City State of Jowston Riou and Jowy were accused of being spies to cover up the real truth of what happened. Riou later became the leader of the Unification Movement and led them to victory over Highland.', 3, 0, 0, NULL, 750, 50, 450, NULL),
