(657, 'Rude', 8, 9, 8, 4, 4, 'fire', 0, 'FF7', 'Definitely the strong silent type: Rude may look like he stepped right out of \"The Matrix\", but do not doubt his existence for a second. Rude is a close friend of Reno, and a member of The Turks. While his demeanor may suggest he is devoid of all emotion, he reveals to Reno at Gongaga that he harbors a secret crush for Tifa Lockheart. Still, if you thought this would stop the party beating Rude and the Turks on several separate occasions you were most certainly wrong!', 1, 0, 0, NULL, 600, 40, 360, NULL),
