(701, 'Shu', 8, 8, 9, 2, 6, 'None', 0, 'Suikoden2', 'Shu was one of many who studied under the famous strategist Mathiu Silverberg. Shu proved to be quit a promising student but he was expelled by Mathiu for using his knowledge for selfish ends. Shu took up as life as a trader and was living peacefully in Radat Town until his old friend Apple came and asked him to help them defeated the Highland Army as their head strategist.', 1, 0, 0, NULL, 600, 40, 360, NULL),
