(797, 'Tir Mcdohl', 10, 10, 4, 6, 9, 'holy', 0, 'Suikoden2', 'Hero from the Toran Liberation War and possessor of the Soul Eater Rune Tir Mcdohl left the Toran Republic after the war and few know his whereabouts. Tir Travels with his close friend and bodyguard Gremio. When Tir encounters Riou he decides to help him in his fight against the Highland Army. Tirs whereabouts after the Dunan Unification war are unknown.', 3, 0, 0, NULL, 750, 50, 450, NULL),
