(813, 'True Friendship', 10, 5, 10, 6, 9, 'None', 1, 'Suikoden2', 'True Friendship is a painting acquired late in the game which refers to the lifelong relationship between Riou, Nanami and Jowy. After the Dunan Unification War when the final duel between Riou and Jowy is fought the three decide the leave the land together. The whereabouts of all 3 are unknown after the left the Highland/City State area.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(814, 'True Runes', 10, 7, 8, 5, 10, 'None', 1, 'Suikoden2', 'Legend has it that all runes were created from the Sword Rune and the Shield rune. Sword claimed it could cut anything and Shield claimed it could block anything. When Sword struck shield they were both shattered into pieces and all the other runes were born. The True Rune known as the Rune of Beginning has two parts: The Black Sword Rune and The Bright Shield Rune. Together these two pieces form the what can be called the first rune.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
