(837, 'Vicious', 9, 2, 7, 6, 10, 'shadow', 0, 'Anime', 'Vicious is a coldblooded and ruthless member of the Red Dragon crime syndicate. Vicious was once partners with Spike Spiegel before Spike supposedly \"died\" and disappeared from the syndicate. Vicious and Spike were often at odds with each other over Julia. Vicious later assassinated the leaders of the Red Dragon Syndicate and proclaimed himself as the one and only leader.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(838, 'Victor', 10, 7, 10, 8, 2, 'None', 0, 'Suikoden2', 'After The Gate Rune War Viktor traveled to the City State of Jowston with Flik and served lady Anabelle as a Mercenary. Viktor joined up with Riou after lady Anabelles death and helped Riou on many parts of his quest to defeat the Highland Army. Viktor also settled his long held grudge with the vampire Neclord who destroyed Viktors home. Viktor also wields the legendary Star Dragon Sword.', 3, 0, 0, NULL, 750, 50, 450, NULL),
