(844, 'Vivi', 10, 3, 10, 9, 5, 'None', 0, 'FF9', 'Vivi is a Black Mage. Nobody knows where the Black Mages comes from. They look like artificial Dolls with her own will. Vivi its a special Black Mage. His influence will differ from all other known Black Mages. But despite his desire, he has doubts about its existence. Who is it. Who am I? What are we doing here? Did it all make sense? A few Questions in his head. Vivi is a nice, sweet but powerful character from Final Fantasy 9.', 3, 0, 0, NULL, 750, 50, 450, NULL),
