(847, 'Vormav Tingel', 10, 9, 4, 6, 10, 'None', 0, 'FFT', 'Vormav Tingel is one of the Church Holy Knights who was named the leader of the New Zodiac Braves. However Vormav appears to have his own goals in mind. Vormav was collecting the 12 Zodiac Stones for his own reasons under the guise of working for the high priest. Vormav will kill anyone who gets in the way of his ambitions including his own son Izlude. His two closest servants are Rofel and Kletian.', 3, 0, 0, NULL, 750, 50, 450, NULL),
