(1045, 'Link', 10, 9, 6, 10, 4, 'None', 0, 'Nintendo', 'Legend of Zeldas Hero. Link, featured in all LOZ games, is a character and the key protagonist in Nintendos The Legend of Zelda series, created by Shigeru Miyamoto. Link is a Hylian boy from the land of Hyrule. His true age unknown as it varies in each game, usually between pre-teen to late teens. Link travels through Hyrule to defeat his primary antagonist, Ganondorf and save Princess Zelda and her kingdom. ', 3, 0, 0, NULL, 750, 50, 450, NULL),
(1046, 'Ness', 10, 9, 3, 6, 10, 'thunder', 0, 'Nintendo', 'The Protagonist of Nintendos Earthbound for the Snes. He was born in Onett, and one day heard a meteorite crashing into a mountain. At the crash site, he met Buzz Buzz, a being from the future who set him on quest to collect the eight melodies and defeat the evil Gigyas. Ness also appears in every smash brothers game, wielding his bat and using his PK.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(1047, 'Kirby', 10, 9, 5, 10, 4, 'wind', 0, 'Nintendo', 'Kirby, described in his games as a young flubbery pink marshmallow thing, is a denizen of Dream Land on the planet Pop Star. In all his games he has the same abilities. He can walk, run, jump, float, inhale, exhale, and so on, but his most popular ability is the ability to take someones powers.\r\n\r\nDespite his cute and cuddly appearance, Kirby can make a nasty opponent by using his power to inhale, exhale, and eat.', 3, 0, 0, NULL, 750, 50, 450, NULL),
