(1221, 'Blitzball Stadium', 10, 2, 9, 9, 10, 'water', 1, 'FFX', 'Blitzball is the form of entertainment in Spira, It allows the population to forget about Sin and the past. The only Stadium in Spira is located in Luca. Blitzball is played in a Giant Stadium in the shape of a Sphere and it is filled with water. The aim of the game is to score more points then the other team in 5 minutes. To score a goal, the team must get the Blitzball into a triangular shaped goal. Characters that can play Blitzball are Tidus, Wakka and Yuna.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
