(2743, 'Pinnochio', 2, 5, 3, 5, 3, 'None', 0, 'KingdomHearts', 'Pinocchio has one dream; to become a real boy, the Blue Fairy may grant this wish as soon as Pinocchio learns to be Kind, Honest and Courageous. After Heartless destroyed his hometown, Pinocchio was then swallowed by Monstro, along with Sora. Riku kidnaps Pinocchio, but is stopped by Parasite Cage. Sora and Riku fight together and win. Riku then steals Pinocchio\'s heart. Sora eventually get the heart back and Pinocchio and Geppetto live happily in Traverse Town. Pinocchio\'s wish is granted.', 1, 0, 1, NULL, 150, 10, 90, NULL),
