(2761, 'Gepetto', 3, 3, 6, 4, 6, 'None', 0, 'KingdomHearts', 'Gepetto is a friendly Clockmaker who is the Father of Pinocchio. Gepetto has a fascination with Gummi Blocks and Gummi Ships. Gepetto travels back-and-forth through many worlds looking for Pinocchio. Later on Sora, Goofy and Donald Duck found Pinocchio.\r\nAfter Monstro destroyed Gepettos hometown, Gepetto made it to Traverse Town and opened up a little shop, where he gives Gummi Ship BluePrint designs to Sora free-of-charge.', 1, 0, 1, NULL, 225, 15, 135, NULL),
