(2853, 'Synthesis Moogle', 8, 9, 2, 9, 5, 'None', 0, 'KingdomHearts', 'Kupo! Moogles are a small fluffy creature with a large red PomPom on their head. Moogles made their way to Traverse Town after their worlds were destroyed by the Heartless. \r\nMoogles work in the Synthesis Workshop which is located in Traverse Town. Sora and the party can make new items by combining old items, this action is known as Item Synthesis and can be helpful to get rare and needed items.', 1, 0, 0, NULL, 600, 40, 360, NULL),
