(2932, 'E-101 Beta', 3, 4, 2, 7, 3, 'Mechanical', 0, 'Sega', 'E-101 Beta is the oldest brother of the E-series machines, he first meets Gamma in the Mystic Ruins base, where they duel for superiority. Gamma defeats Beta and is granted permission to travel aboard the Egg Carrier along with the other E-series machines. Beta, however, clearly upset about this, moves in front of Gamma as a plea to also join the others. He is told he can be used for spare parts by Robotnik and is not seen till much later in Gammas Story.', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2933, 'E-103 Delta', 3, 4, 4, 5, 5, 'Mechanical', 0, 'Sega', '', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2934, 'E-104 Epsilon', 3, 4, 5, 1, 6, 'Mechanical', 0, 'Sega', 'Coming after Delta, E-104 Epsilon shared much the same relationship with Gamma and Beta as Delta did. After failing to capture Froggy, along with Delta and Zeta, Epsilon was removed from the Egg Carrier crew. When Gamma Encounters Epsilon inside the caverns of Red Mountain, Epsilon, now with a gun on each hand, battles with Gamma, Gamma emerges victorious and saves the creature inside Epsilon and begins searching for Zeta.', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2935, 'Nozomi', 3, 6, 1, 5, 4, 'None', 0, 'Sega', '', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2936, 'Tikal', 3, 7, 3, 3, 3, 'None', 0, 'Sega', '', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2937, 'Tom Johnson', 3, 7, 3, 4, 2, 'None', 0, 'Sega', '', 1, 0, 1, NULL, 225, 15, 135, NULL),
(2938, 'Zero', 3, 3, 4, 3, 6, 'Mechanical', 0, 'Sega', 'E-100, or Zero as everyone calls him, was the first (and probably the most differential of the series) of the E-series machines to be created to help Robotnik recover the Chaos Emeralds.  He spent most of Sonic Adventure tracking down Amy Rose because she befriend a flicky in possession of a chaos emerald, and succeeded in capturing her. Zero served as the final boss for Amys story, where she defeats him with ease.', 1, 1, 1, NULL, 225, 15, 135, NULL),
