(2965, 'E-105 Zeta', 6, 2, 5, 8, 7, 'Mechanical', 0, 'Sega', 'E-105 Zeta was the final known E-series creation by Dr. Robotnik. Zeta, having failed with the others to capture Froggy, appeared to have been forced away by Robotnik, which was clearly untrue as Zeta underwent a rather powerful change. He became a large defense turret in the Hot Shelter and proved a powerful adversary for Gamma, but emerging victorious, Gamma had defeated all of his friends.', 1, 0, 0, NULL, 450, 30, 270, NULL),
