(2980, 'E-101 Beta MkII', 7, 6, 5, 8, 6, 'Mechanical', 0, 'Sega', 'The Mark II version of Beta was by far superior to the other E-series machines than his previous model. Gamma accidentally stumbled into the room where Beta was undergoing his changes when asked to do something else. The MkII upgrade gave Beta more Agility, more power and less remorse, making him a formidable machine. Gamma and Beta then scuffled it out, Gamma barely won, but his victory was short lived as Beta let out a final blast upon Gamma.', 1, 0, 0, NULL, 525, 35, 315, NULL),
