(2988, 'E-102 Gamma', 8, 8, 2, 9, 6, 'Mechanical', 0, 'Sega', 'E-102 Gamma earned his spotlight in the Sonic Universe for being the first of Dr. Robotniks machines to ever rebel against his creator, which led to many more doing the same. This was caused by the Red Flicky used to create Gamma who shared a deep bond with his brothers, a White Flicky, contained inside E-101 Beta, and a Blue Flicky, who befriended Amy Rose. Gamma also became the first character to ever die in Sonic History, this was caused by a climactic final battle to save his brother, Beta.', 1, 0, 0, NULL, 600, 40, 360, NULL),
(2989, 'E-123 Omega', 8, 9, 7, 1, 7, 'Mechanical', 0, 'Sega', 'E-123 is Dr. Robotniks most powerful E-series machine. Unfortunately for Omega, Robotnik sealed him inside a room along with a rescued Shadow the Hedgehog, in some form of Stasis. It was not until Rouge came across the room that Omega destroyed everything trying to kill Shadow as he thought Shadow was one of Robotniks Machines. Eventually, Omega warms up to Rouge and Shadow, solidifying a friendship with the two, who see Omega as a powerful ally in stopping Robotnik because of his driven hatred.', 1, 0, 0, NULL, 600, 40, 360, NULL),
