(3009, 'Billy Hatcher', 10, 6, 9, 10, 3, 'None', 0, 'Sega', 'Billy Hatcher was in for the adventure of his life when he was magically transported to Morning Land and help save this mystery world.\r\nThe Chicken King gave Billy the quest to rescue the 6 Chicken Elders in order to restore Morning Land back to normal. If Billy fails to save Morning Land, the darkness which has taken over Morning Land, will begin to engulf the land Billy came from; The Human World.', 3, 0, 0, NULL, 750, 50, 450, NULL),
