(3011, 'Knuckles', 10, 10, 5, 5, 9, 'earth', 0, 'Sega', 'An echidna born wild and tough. Knuckles loves to laze around near the master emerald and to do his sworn duty of protecting the Master Emerald and Angel Island from a horrid fate. Knuckles is an amazingly strong echidna and those gloves he wears are not just for show. \r\n\r\nHe is ruthless but deep down is a gentle guy who will do what is right when it is required.', 3, 0, 0, NULL, 750, 50, 450, NULL),
