(3015, 'Shinobi', 10, 6, 2, 9, 10, 'None', 0, 'Sega', 'Ninja master: As a small child, Joe Musashi was a very weak kid. However, though training and perseverance, he rises to be one of the most respected ninja of the Oboro clan. He is confident in his abilities, wearing a white instead of black. He\'s not to be taken lightly, be it in the darkest of the nights or the lightest of the days. Skilled in the use of shurikens, ninjutsu, horseback riding, and even surfing, it is no wonder he takes his battles into the open.', 3, 0, 0, NULL, 750, 50, 450, NULL),
