(3793, 'General Greil', 10, 9, 9, 2, 10, 'None', 1, 'FireEmblem', 'Commander Greil of the Greil Mercenaries was the father of Ike and Mist, one of the old Riders of Daein, and teacher of both his son Ike and Zelgius, the Black Knight. Greils strength was legendary even after crippling himself, his power was still fearsome. It took the sacred blade Alondite to defeat him. In Triple Triad Extreme, Greils essence has been captured into a Special Edition card, in all of his pure, unhindered glory. ', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(3794, 'Greils Mercenaries', 10, 4, 6, 10, 9, 'None', 1, 'FireEmblem', 'The Greil Mercenaries are a band of fighters who seek justice- for the right price. However, they are honorable, and they are willing to fight simply for what they believe in. Formerly led by their namesake, Greil, when Greil was slain, Ike, Greils son, took command. Leading both the mercenaries themselves, and many other allies, Ike, together with his comrades, took to the field of battle. With this card, you can unleash the full power of the Greil Mercenaries in your card duels.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
