(3802, 'Ike', 10, 10, 5, 6, 8, 'None', 0, 'FireEmblem', 'Ike, son of Greil, is the leader of the Greil Mercenaries, and the most fearsome warrior in all of Tellius. Though Ike started as an average swordsman, through the course of three years, Ike grew from simple minded mercenary, thrust into conflict, to legendary hero, who even defeated a goddess himself. He always fights for his friends, and what he believes in.', 3, 0, 0, NULL, 750, 50, 450, NULL),
