(3804, 'Macaiah', 10, 7, 7, 10, 5, 'None', 0, 'FireEmblem', 'Macaiah is known around Daein as the Silver Haired Maiden. She has the ability to foresee the future, and can use her own life force to heal even those on the door of death. Macaiah would eventually become the vessel for the Chaos Goddess, Yune, when Ashera, Goddess of Order, petrified the world. Together with Ike and countless allies, as well as the blessings of Yune, Macaiah ventured forth to defeat Ashera and restore the world.', 3, 0, 0, NULL, 750, 50, 450, NULL),
