(4265, 'Sarah the Mage', 10, 10, 8, 6, 4, '', 0, 'Suikoden3', 'Sarah was a first class magician even as a child. Her skills made her life very hard. People of her hometown called her a witch and blamed her for her endowment. She was raised in a holy shrine of Harmonia were Luc afterwords found her and took her with him to Leeknat were she advanced her skills but also her feelings for Luc. Lend by her unconditional love 2 Luc her fate was to die along his side trying to end the worlds fate but destiny was against her.', 3, 0, 0, NULL, 750, 50, 450, NULL),
