(4273, 'Geddoe the Immortal', 10, 7, 9, 10, 2, '', 0, 'Suikoden3', 'Twelfth Harmonian Southern Frontier Defense Force Unit captain: Bearer of the True Lightning rune. Not much is known about this man, other than the fact that he was friends with the Flame Champion. After a confrontation that forced him to reveal his secrets, he decides to give up being a captain; his team, however, would not allow that, thus he continues fighting. At over 100 years old, its amazing he can still fight.', 3, 0, 0, NULL, 750, 50, 450, NULL),
