(4285, 'Demon Inuyasha', 10, 7, 10, 3, 8, 'shadow', 1, 'Halloween', 'Demon Inuyasha first appears when Goshinki, an Incarnation of Naraku, bites the Tetsusaiga and breaks it, making Inuyashas demon blood take over him and sends him into a state of bloodlust. Inuyasha, unable to barely control himself, slaughters Goshinki with his bear hands, without the use of tetsusaiga. It was not until Kagome stepped in to stop Inuyasha that he realized what he had become.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
