(4288, 'Dry Bowser', 10, 7, 8, 10, 4, 'fire', 1, 'Halloween', 'Dry Bowser was created by Bowser Junior. Being used by his own Son to halt Mario in New Super Mario Bros. But with being bashed and hurled into the lava (classic Mario cliche) Bowser was not seen till much later on. When he returns however, he is much like the numerous Dry Bones, unlike his smaller counterparts however, he is not invincible, and Mario defeats him with relative ease. Dry Bowser later made a comeback as an unlockable driver in Mario Kart Wii.\r\n', 0, 0, 0, NULL, 1000, 50, 450, NULL),
