(4292, 'Killey', 10, 5, 4, 10, 9, 'shadow', 1, 'Halloween', 'Killey is from a tribe the northern parts of the Queendom of Falena. His red clothing is a symbol of their legendary bird. Killey has long been researching the ancient and mysterious people known as the Sindar. He travels all over the world exploring the ruins left behind by the cryptic and long forgotten people. Killey can be quit violent in his pursuit of the Sindar and was once falsely imprisoned for 3 years on account of bad information.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4293, 'Kyos True Form', 10, 5, 10, 4, 8, 'shadow', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
