(4295, 'Omega Weapon', 10, 9, 10, 3, 5, 'shadow', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4296, 'Oni Link', 10, 6, 7, 6, 10, 'shadow', 1, 'Halloween', 'After collecting every Mask that the land of Termina had to offer, Link ventured top the Clock Tower to defeat the Skull Kid who wore Majoras Mask. However, discarding the Skull Kid and hiding within the Moon, Majoras Mask actually gave Link the Fierce Deity mask. This mask allowed a small 12 year old boy to become an adult warrior. Using the mask, this transformed him into Oni Link, making him a formidable force and making the final battle practically effortless.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4297, 'Sonic Unleashed', 10, 10, 8, 8, 2, 'shadow', 1, 'Halloween', 'Sonic the Werehog became unleashed in 2008. Using the power of the Chaos Emeralds to become Super Sonic, he was in a heated battle with the sinister Dr. Robotnik. However, caught off guard, Sonic began a hideous transformation thanks to one of Robotniks latest machines, using the power of the chaos emeralds once more. Sonic had become a Werehog by night. Befriend by his new friend Chip, Sonic began his quest to turn himself back into the way he was.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4298, 'The Invincible', 10, 7, 9, 10, 3, 'wind', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4299, 'Ultimecia', 10, 8, 1, 9, 10, 'shadow', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4300, 'Vegnagun', 10, 10, 9, 2, 7, 'thunder', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4301, 'You Are Dead', 10, 7, 4, 7, 10, 'None', 1, 'Halloween', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4302, 'Cleffa', 1, 4, 5, 2, 1, 'holy', 0, 'Johto', 'Cleffa is rumored to have arrived from outer-space riding on a meteor. These theories were raised due to a few matters; Cleffas silhouette is Star Shaped, Cleffa  are seen a lot more if there is a meteor in the night sky, also on nights where shooting stars are seen, Cleffa seems to dance in a ritual trance.\r\n\r\nCleffa is 1 ft tall and weighs 6.6 lbs.', 1, 1, 1, NULL, 75, 5, 45, NULL),
(4303, 'Igglybuff', 1, 3, 2, 3, 4, 'holy', 0, 'Johto', '', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4304, 'Marill', 1, 5, 3, 2, 1, 'water', 0, 'Johto', 'Rumored to be \"Pikablu\", Marill was one of the select few Johto Pokemon that was shown before Gold & Silver was released. Marills tail is used as a buoyancy float, if Marill dives underwater, its tail will float, this prevents Marill from drowning in all bodies of water. \r\nMarill is 104\" tall and weighs 18 lbs.', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4305, 'Pichu', 1, 1, 4, 5, 1, 'thunder', 0, 'Johto', 'Pichu, the baby of the all-star favorite Pokemon; Pikachu. Pichu is very easily startled, if it plays very closely with other Pichu, they might short out power and set off a flurry of bright sparks, the Pichu will then be startled and begin to cry.\r\nIt is very common for a Pichu to get over excited whilst playing with its trainer and accidentally zap its owner, Pichu will then cry from fright.\r\nPichu is 1 foot tall and weighs 4 lbs.', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4306, 'Sentret', 1, 4, 2, 1, 5, 'None', 0, 'Johto', 'Sentrets scout the area by sitting on their tail and then viewing its surroundings, if it can see or smell danger, it will let out a cry to warn other Sentret in its colony. When Sentret sleep, there is a scout awake, looking for danger, if danger comes, it will awake the others in a panic.\r\nSentret is 207\" tall and weighs 13.2 lbs.', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4307, 'Spinarak', 1, 1, 1, 6, 2, 'poison', 0, 'Johto', '', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4308, 'Sunkern', 1, 4, 1, 2, 4, 'None', 0, 'Johto', 'Sunkern is all about reserving and storing energy. Sunkern spends all day in the sun building energy and nutrients. Sunkern hardly ever moves, as moving consumes energy, so it drinks morning dew off of grass and leaves. The reason Sunkern saves energy is for evolution.\r\nSunkern is 1 foot tall and weighs 4 lbs.', 1, 0, 1, NULL, 75, 5, 45, NULL),
(4309, 'Togepi', 1, 1, 1, 5, 3, 'holy', 0, 'Johto', 'Togepi, quite arguably the happiest Pokemon ever.\r\nTogepi will share happiness with anyone who treats it kindly and well. It is said that it keeps its happiness and nice thoughts inside its shell, ready to share with anyone at anytime. Togepi was among the first of the Johto Pokemon to be revealed to the public before the release of Gold & Silver.\r\nTogepi is 1 foot tall and weighs 3.3 lbs.', 1, 0, 1, NULL, 75, 5, 45, NULL),
