(4403, 'Master Ball', 10, 8, 10, 4, 8, 'None', 1, 'Johto', 'The Master Ball is the Ultimate Pokeball. It is given to you by Professor Elm. It is Dark Purple in color with Light Purple inserts, it also has a M written on the front of it. There is only One Master Ball per region. Master Ball is a one-time ball and has 100% catch rate on all wild Pokemon. Master Ball is featured on most Pokemon games and even in the Trading Card Game.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4404, 'Red Gyarados', 10, 9, 8, 3, 10, 'water', 1, 'Johto', 'Red Gyarados is commonly mistaken as being a typical Shiny Pokemon. It is red in color due to a Magikarp evolving prematurely (Usually forcefully by Electro-Magnetic Waves), giving no time for the natural path of evolution where the Red Scale pigment on Magikarp turns Blue in color just before it evolves. This causes Gyarados to keep the color they were when they were a Magikarp. Red Gyarados can be found at Lake Rage in the Johto Region.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
