(4412, 'Kyaros Children', 10, 4, 7, 6, 10, 'None', 1, 'Valentines', 'Jowy Atreides has always had a childhood crush on the Royal Princess Jillia blight. When asked by Luca Blight what he wanted as a reward for capturing the City of Greenhill Jowy Replied \"I want your sister Jillia as my wife\" Luca was amused by Jowys boldness but Jowy persuaded Luca with a plot to kill the king which would make Luca king. Jowy later plotted Lucas Death and thus became king being married to the Princess. ', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4413, 'Lost Promise', 10, 8, 7, 10, 2, 'None', 1, 'Valentines', '', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4414, 'More Than A Memory', 10, 8, 6, 9, 5, 'None', 1, 'Valentines', 'Only she could take the Malice form his heart, but in doing so she was taken over, giving her life for her love. He searched for a way to bring her back, defying the laws of physics trying to put her soul back into her lifeless body. To no avail he was forced to move on, his heart still heavy, eventually he found peace in death with his true savior, and took one last train ride together.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
(4415, 'Pink Yoshi', 10, 5, 5, 9, 9, 'None', 1, 'Valentines', 'Pink Yoshis was first available on Level 2 of each world in Super Mario World 2: Yoshis Island. Pink Yoshi then went on to appear in many game later on such as Mario Power Tennis, Paper Mario: The Thousand Year Door, Yoshis Island and more. \r\nPink Yoshi is Pink in skin color; as opposed to the typical Green Yoshi  (As seen in the Nintendo Deck), he also has yellow shoes and a red saddle.', 0, 0, 0, NULL, 1000, 50, 450, NULL),
