(4544, 'Kunoichi Kasumi', 10, 10, 6, 4, 9, '', 0, 'Legends', 'Kasumi a.k.a The Kunoichi of Destiny is a 17 year old girl from the Mugen Tenshin clan. She abandoned the village to avenge her brother, Hayate, knowing that she would be branded a traitor and people from her own village would vie to kill her. Ayane, Kasumis younger half-sister, is always in pursuit of her and attempts to kill her. Kasumi, always looking for her brother to try and make ends meet, fails to realize she can never be accepted into the Mugen Tenshin again.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4545, 'Lara Croft', 10, 4, 10, 9, 6, '', 0, 'Legends', '', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4546, 'Marcus Fenix', 10, 3, 10, 8, 8, '', 0, 'Legends', 'After abandoning his mission and squad at his fathers request, Marcus was sent to trial where he was thrown into jacinto Prison and left for dead. Then, one day, thanks to his best friend, Dominic Santiago, Marcus is freed from Prison and enlisted against his choice, as a COG soldier, with a rank no higher than that of a Grunt. Looked down upon by his peers ( and not really caring) Marcus soon changes that around with the lightmass bombing, and earns the respect of everyone.', 3, 0, 0, NULL, 750, 50, 450, NULL),
