(4564, 'Bill', 8, 5, 9, 6, 6, 'None', 0, 'Legends', 'Bill is one of the four survivors of the zombie apocalypse in the first person shooter, Left 4 Dead. You play as either Bill, Louis, Zoey or Francis two weeks after the first infection, and work your way to survival.\r\nBill is known for his dislike of Francis, his old man slang, and his \"appreciation\" of stairs.\r\n\"Ill see peace on Earth if I have to kill each and every one of these B*****ds!\"', 1, 0, 0, NULL, 600, 40, 360, NULL),
