(4573, 'Anthony Carmine', 7, 6, 7, 8, 4, 'None', 0, 'Legends', 'Anthony Carmine served as one of Delta Squads initial members. Anthony is one of the 4 Carmine brothers all enlisted to the COG army. Under the command of Lt. Kim, He assists along the way to the House of Sovereigns, once there and eliminating a Locust threat, Anthony encounters a problem with his gun jamming when he reloads, this problem ultimately leads to his death when enemy snipers locate an unaware Delta Squad, Anthony, unlucky enough to be the easiest target.', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4574, 'Benjamin Carmine', 7, 3, 7, 8, 7, 'None', 0, 'Legends', 'Benjamin Carmine is the youngest of the Carmine brothers. In a twist of fate, he joins Delta squad as Marcus new Trainee, and as green as grass. Unlike his older brother, Ben spends a good portion of the game alive, outliving other characters. However, much to the fate of the Carmines, in a rescue attempt, the giant rift worm knocks Ben out of the Raven, but he survived this, when Marcus and Delta squad find Ben, he is being attacked by Nemacytes and is badly burned by acids.', 1, 0, 0, NULL, 525, 35, 315, NULL),
