(4594, 'Hunter', 5, 3, 5, 7, 6, 'None', 0, 'Legends', 'Hunters are the common boss infected powerhouses. They aim to pounce on a single survivor, and claw at them relentlessly without mercy. Hunters are easily stopped my simple melee shoves and well aimed shots. a Hunter is most effective when hes moving, making him a hard target to hit. a Hunter Pouncing a survivor in the midst of a Boomer attack is lethal as some survivors may not notice the sound, or hear their fellow survivors being clawed at by this demon.', 1, 0, 0, NULL, 375, 25, 225, NULL),
