(4605, 'Smoker', 4, 5, 7, 5, 2, 'None', 0, 'Legends', 'Smokers are at best when they are far away behind, or on top of a roof. Their long tongues can extend phenomenal distances to grab survivors, and pull them away from the rest of their teammates, The Smokers is fairly weak and vulnerable, and incredibly easy to spot, even from a distance. Once a smokers tongue latches onto a survivor, they have a measly 2 seconds to kill the smoker or they will get dragged away.', 1, 1, 0, NULL, 300, 20, 180, NULL),
