(4607, '343 Guilty Spark', 4, 4, 5, 4, 6, 'mechanical', 0, 'Legends', '343 Guilty Spark is an Artificial Intelligence from the Halo game series. He is the monitor left by the ancient race of the Forerunner to monitor Installation 04 (the first Halo ring to be discovered by the humans). He is the main antagonist of the first Halo game, insisting that he follows protocol and attempts to fire Installation 04 (thus wiping every sentient being within 25,000 light years) to contain the parasitic life form \"the Flood\", in which the Installations were constructed for.', 1, 0, 0, NULL, 300, 20, 180, NULL),
