(4626, 'Boomer', 3, 2, 7, 2, 5, '', 0, 'Legends', 'Boomers are slow, weak and easy targets for trigger happy survivors. In Left 4 Dead, Boomers serve as a Horde magnet, a successful Boomer Bile attack from one of these nasties can cloud a players vision, and call upon as much as 20+ Horde a time, which leaves for a quick decision or else you suffer. Boomer are also full of Methane, Shooting one at close range will have the same effects, except the explosion causes one to stagger for 2 seconds before the oncoming Horde.', 1, 0, 0, NULL, 225, 15, 135, NULL),
