(4642, 'Minh Young Kim', 1, 1, 3, 3, 5, '', 0, 'Legends', 'Lieutenant Kim was the original leader of Delta Squad. Kim is a strictly by the book soldier, following orders without hesitation. Kim led Delta Squad through the city, and eventually to the tomb where they rendez-vous with Alpha Squad. A mortar attack on the Raven meant to rescue them, creates an impassible fire. A Helpless Marcus looks on as General RAAM kills Kim, who is focused only about his teams survival. Marcus is promoted to Sergeant and leader of Delta Squad following Kims death.', 1, 0, 0, NULL, 75, 5, 45, NULL),
