(4786, 'Animal Man', 1, 1, 5, 1, 4, 'none', 0, 'MarvelDC', 'Animal Man (Bernhard \"Buddy\" Baker) is a fictional DC Comics superhero. As a result of being in proximity to an exploding extraterrestrial spaceship, Buddy Baker acquires the ability to temporarily \"borrow\" the abilities of animals (such as a birds flight or the proportionate strength of an ant). Using these powers, Baker fights crime as the costumed superhero Animal Man.', 1, 0, 0, NULL, 75, 5, 45, NULL),
(4787, 'Booster Gold', 1, 4, 1, 4, 2, 'none', 0, 'MarvelDC', 'Booster Gold is a DC character who first appeared in the comic Booster Gold in 1986, and has been a member of the Justice League. \r\n\r\nAt first, the character is shown as a glory-seeking incompetent from the future, who uses knowledge of historical events and futuristic technology to stage rescues in search of fame. Booster later develops over the course of his subsequent publications and through personal tragedies becomes a hero troubled by the reputation he has created for himself.', 1, 0, 0, NULL, 75, 5, 45, NULL),
