(4863, 'The Comedian', 7, 5, 8, 5, 7, 'none', 0, 'MarvelDC', 'The Comedian (born Edward Morgan Blake) started his superhero career in a group called the Minutemen in the 1940s, and later, after the group disbanded, joined the Watchmen in 1970s.\r\n\r\nHe was contracted by the government to assist them in many different matters because of his ruthless and effective abilities. After the Keene Act of 1977 (a law banning all vigilantism, banning all superheroes), The Comedian and Dr Manhattan are the only two government-permitted superheroes left active.', 1, 0, 0, NULL, 525, 35, 315, NULL),
