(4876, 'Ozymandias', 8, 9, 9, 4, 2, 'none', 0, 'MarvelDC', 'Ozymandias (born Adrian Veidt) draws most of his inspiration from Alexander of Macedonia (Alexander the Great) and the Egyptian pharaoh which his superhero name has come from. By the age of 17 both his parents had passed away, leaving him a fortune which he donated it all to charity to prove he could make it on his own.\r\n\r\nHe is thought to be at the peak of physical and mental human ability, considered the smartest man on Earth. He is even thought to be able to catch a bullet.', 1, 0, 0, NULL, 600, 40, 360, NULL),
