(4887, 'Dr Manhattan', 9, 8, 5, 10, 3, 'none', 0, 'MarvelDC', 'After a freak accident at an government base in 1959, Dr. Manhattan (born Jon Osterman) a device caused his Intrinsic Field to be removed. He learned how to rebuild himself and therefore learning how to manipulate matter at the sub-atomic level.\r\n\r\nDr. Manhattan does not perceive time in a linear perspective, seeing all of time at once. Throughout the course of Watchmen, Doctor Manhattan seems to \"drift away\" from humanity and its social habits, due to his perception of time and life itself.', 2, 0, 0, NULL, 675, 45, 405, NULL),
