(4899, 'Rorschach', 10, 8, 8, 10, 2, 'none', 0, 'MarvelDC', 'The main protagonist of the Watchmen graphic novel, Rorschach (born Walter Joseph Kovacs) is a \"detective superhero\" of sorts, even though he does not possess any superpowers of his own. Throughout the events of Watchmen he pursues his \"mask killer\" theory.\r\n\r\nHis mask is based on the psychological \"Rorschach inkblot test\", with heat-sensitive liquids suspended inside, which move according to his facial expressions, \"always changing, never mixing into gray\". He considers the mask his \"face\".', 3, 0, 0, NULL, 750, 50, 450, NULL),
