(4903, 'The Smiley Badge', 10, 9, 6, 9, 6, 'none', 1, 'MarvelDC', 'The Comedians smiley badge, worn during his active years as a superhero working for the government. The Comedians badge is known to be the most iconic symbol from the graphic novel \"Watchmen\".\r\n\r\nAfter The Comedian is murdered at the beginning of the graphic novel, a blood stain is left on the face of the badge, which coincidentally mimics a clock face being five minutes to midnight, just as the \"Doomsday Clock\" in Watchmen is set to.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4904, 'Justice League Satellite', 10, 9, 9, 10, 2, 'none', 1, 'MarvelDC', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4905, 'End of Krypton', 10, 7, 10, 8, 2, 'none', 1, 'MarvelDC', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4906, 'Civil War', 10, 9, 10, 3, 6, 'none', 1, 'MarvelDC', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4907, 'Marvel vs DC Universe', 10, 8, 10, 6, 6, 'none', 1, 'MarvelDC', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4908, 'Soul Eater Rune', 10, 10, 7, 4, 9, 'shadow', 1, 'Suikoden1', 'The Soul Eater Rune is one of the 27 True Runes which is also known as \"The Rune of Life and Death\". It was hidden in a village in the possession of the Village elder for a long time then was given to Ted to keep it hidden. Upon being discovered by Windy Ted gave the rune to his best friend Tir after holding it for over 300 Years.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4909, 'Golden Hydra', 10, 2, 10, 9, 9, 'none', 1, 'Suikoden1', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4910, 'Star Dragon Sword', 10, 8, 8, 4, 10, 'shadow', 1, 'Suikoden1', 'The Star Dragon Sword is an intelligent and also quite arrogant weapon who claims to be an incarnation of the Rune of Night (one of the 27 True Runes). As an incarnation of the Night Rune the sword has power over any creature of the night thus it is the only way to destroy the vampire Neclord. The sword was first retrieved by Viktor to slay Neclord and then Viktor had to get it again when he learned Neclord wasnt truly destroyed. The sword was later given to Edge by Viktor.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4911, 'Toran Castle', 10, 10, 3, 8, 8, '', 1, 'Suikoden1', '', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4912, 'Fathers Last Words', 10, 7, 10, 4, 7, 'none', 1, 'Suikoden1', 'With Tir Mcdohl becoming a fugitive from the Scarlet Moon Empire and the leader of the Liberation Army it was only a matter of time before he had to face his father General Teo Mcdohl. Upon being defeated by his son Teo expressed that \"The greatest happiness a father can experience is to see his son surpass himself\". Teos last wish was for Alen and Grenseal to join his son Tir and not to follow in his foot steps.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(4913, 'Tir', 10, 5, 10, 5, 9, 'shadow', 0, 'Suikoden1', 'Tir Mcdohl is the only child of General Teo Mcdohl. While his father is away defending the northern border Tir runs into trouble upon Teds Soul Eater Rune being discovered. Ted gives Tir the rune for save keeping and  Tir is forced to leave Gregminster and later becomes Leader of the Toran Liberation Army. Tir led the army to victory ,but lost many people close to him along the way.', 3, 0, 0, NULL, 750, 50, 450, NULL);
INSERT INTO `cards` (`id`, `cardname`, `level`, `left`, `right`, `up`, `down`, `element`, `flggold`, `deck`, `Lore`, `TokenCost`, `NoTrade`, `NoShop`, `CardMetaKeywords`, `Crystals`, `Vendor`, `Transmute`, `CardInfo`) VALUES
(4914, 'Ted', 10, 8, 10, 7, 4, 'shadow', 0, 'Suikoden1', 'Ted has been the possessor of the Soul Eater Rune for over 300 years. Since his home was attacked and his grandpa gave him the rune and told him to run and keep the rune hidden. Ted was living in the home of Teo Mcdohl when his Rune was discovered he gave it to the only person he could trust to keep it safe, his best friend Tir Mcdohl.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4915, 'Lepant', 10, 10, 6, 6, 6, '', 0, 'Suikoden1', 'Lepant was once a successful merchant who wished to stay uninvolved in the revolt against the empire. However, after his wife was taken prisoner and freed by Tir Lepant decided to join the Liberation Army along with his wife Eileen. Lepant later becomes the first President of the Toran Republic after the Scarlet Moon Empire is defeated.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4916, 'Flik of the Blue Lightning', 10, 10, 8, 2, 7, 'thunder', 0, 'Suikoden1', 'Flik was one of the original members of the Toran Liberation Army and lover of Odessa. After their hideout what discovered and Odessa was killed Flik joined Tir Mcdohl who had become the new leader of the Liberation Army. A custom in the Warriors Village where Flik was born is to put the name of the one you most love on your sword, Fliks Sword is named Odessa after his late lover.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4917, 'Viktor', 10, 10, 8, 7, 2, 'none', 0, 'Suikoden1', 'Viktor was an original member of the Toran Liberation Army and was the one who introduced Tir Mcdohl to their leader Odessa. When the hideout was attacked and Odessa was killed Viktor traveled with Tir to help fulfill Odessas last request and deliver a ring to her older brother Mathiu. Viktor played a large role in the defeat of the Scarlet Moon Empire and was missing in action after the final battle.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4918, 'Mathiu', 10, 8, 1, 8, 10, 'none', 0, 'Suikoden1', 'Mathiu comes from the Silverberg family which has been famous for over a hundred years as renowned military tacticians. Mathiu is the nephew of Leon Silverberg and the Older brother of Oddessa Silverberg. Mathiu took part in a massacre known as the Kalkekka Incident and after that he wished to never again see the site of people dying by his own actions. However once the Scarlet Moon Empire threatened his him if he would not return to service he join the Liberation Army.\r\n', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4919, 'Joshua Levenheit', 10, 7, 9, 10, 1, 'wind', 0, 'Suikoden1', 'Joshua Levenheit is the leader of the Knights of the Dragons Den and he is also the owner of the Dragon Rune one of the 27 True Runes which allows dragons to exist in this world. Upon receiving a visit from his old friend Humphrey Joshua agrees to give the support of the Dragon Knights to Tir the leader of the Liberation Army.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4920, 'Crowley', 10, 9, 2, 6, 10, 'wind', 0, 'Suikoden1', 'Crowley is a legendary wizard of incredible power known throughout the land as the greatest wizard of all time. Crowley is said to have over 100 runes embedded in his body and also studies powerful runes such as the 27 True Runes. Crowley also has an Arch-Rival named Mazus who is also a formidable wizard. They once dueled on top of a mountain and caused it to rain for a week and the mountain was leveled.', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4921, 'Black Knight Pesmerga', 10, 6, 10, 6, 7, 'none', 0, 'Suikoden1', '', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4922, 'Yuber', 10, 9, 2, 10, 8, 'none', 0, 'Suikoden1', '', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4923, 'Windy', 10, 9, 6, 10, 4, 'none', 0, 'Suikoden1', '', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4924, 'Barbarossa', 10, 5, 5, 9, 10, 'none', 0, 'Suikoden1', '', 3, 0, 0, NULL, 750, 50, 450, NULL),
(4925, 'Teo Mcdohl', 9, 10, 5, 5, 5, '', 0, 'Suikoden1', 'Teo Mcdohl is one of the Great Generals of the Scarlet Moon Empire. Trusted greatly by Emperor Barbarossa Rugner, Teo is asked to travel north to defend the border. While he is away defending his country his son Tir decides to fight against the empire as the leader of the Liberation Army. Teo later will be forced to fight on behalf of his emperor against his own son.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4926, 'Sonya Shulen', 9, 1, 8, 10, 7, 'water', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4927, 'Milich Oppenheimer', 9, 6, 10, 4, 7, 'poison', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4928, 'Kwanda Rosman', 9, 4, 6, 10, 6, 'fire', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4929, 'Kasim Hazil', 9, 10, 7, 7, 2, 'none', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4930, 'Ain Gide', 9, 5, 10, 5, 5, 'none', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4931, 'Mace', 9, 1, 6, 9, 10, 'fire', 0, 'Suikoden1', 'Mace is a famous master blacksmith without equal who is known throughout the Scarlet Moon Empire. He isnt fond of people but is very kind to his 4 apprentices and joins the  Toran Liberation Army when Maas , Meese , Mose and Moose all show up at his house in the mountains and ask him to help Tir Mcdohl. Mace retires after the war and names Moose Master Blacksmith.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4932, 'Maximillian', 9, 5, 5, 10, 5, 'none', 0, 'Suikoden1', 'Max is the leader of the Maximillian Knights. Despite is age Max is as eager to fight as any and when he learns of the war in the Scarlet Moon Empire he travels along with his loyal squire Sancho to join Tir Mcdohl in his war against Emperor Barbarossa Rugner of the Scarlet Moon Empire. Maxs Knights are also the strongest Infantry unit in the game during Major Battle scenes.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4933, 'Rune Mistress Jeane', 9, 5, 7, 5, 10, 'none', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4934, 'Rubi', 9, 10, 6, 7, 4, 'none', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4935, 'Gremio', 9, 2, 5, 9, 10, 'none', 0, 'Suikoden1', 'Gremio was living the house of Teo Mcdohl as his sons personal body guard. Gremio often took care of Tir because Teo was away fighting for Emperor Barbarossa. Gremio almost thought of Tir as his own son and later he made the ultimate sacrifice and gave his life to save Tir. However upon gathering all the 108 Stars of Destiny Gremio is resurrected by Leknaat.', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4936, 'Humphrey Mintz', 9, 4, 9, 4, 10, 'none', 0, 'Suikoden1', '', 2, 0, 0, NULL, 675, 45, 405, NULL),
(4937, 'Cleo', 8, 9, 9, 3, 3, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4938, 'Pahn', 8, 6, 9, 4, 6, 'none', 0, 'Suikoden1', 'Pahn served as a Body guard for Teo Mcdohls son Tir. While Teo was away and Tirs friend Ted was wanted by the court magician Pahn thought it best to cooperate with the town guard and turned Ted in betraying his friends. Pahn later realized his mistake and asked Tir to forgive him and joined the Liberation Army. Later when the Tir was fleeing after being defeated by Teo Mcdohls armored cavalry Pahn stayed behind and fought General Teo one on one to by Tir time to escape.', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4939, 'Rebel Valeria', 8, 3, 7, 6, 9, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4940, 'Ninja Kasumi', 8, 9, 1, 6, 9, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4941, 'Varkas', 8, 9, 3, 9, 3, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4942, 'Kai', 8, 8, 4, 9, 3, 'none', 0, 'Suikoden1', 'Kai was Tir Mcdohls instructor that taught him how to use a Staff. Kai lived in the Mcdohl house until he vanished one day without warning. He joined up with Tir during the Gate Rune War and helped Tir defeat the Scarlet Moon Empire. Tir holds a great amount of respect for Kai and still calls him Master.', 1, 0, 0, NULL, 600, 40, 360, NULL),
(4943, 'Grenseal', 8, 9, 7, 7, 1, 'thunder', 0, 'Suikoden1', '', 1, 0, 0, NULL, 600, 40, 360, NULL),
