(4949, 'Gunner Clive', 7, 3, 8, 4, 8, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4950, 'Liukan', 7, 8, 8, 4, 4, 'none', 0, 'Suikoden1', 'Liukan is a famous doctor in the Toran Republic as well as other parts of the world. Liukan was living his life out as hermit until one day Tir showed up asking for help shortly before Milich showed up and took Liukan prisoner. Tir freed Liukan and the doctor joined the Toran Liberation Army and saved many lives and continued his work as a doctor after the war ended.', 1, 0, 0, NULL, 525, 35, 315, NULL),
