(4955, 'Fu Su Lu', 7, 4, 4, 8, 8, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4956, 'Anji', 7, 8, 4, 8, 5, 'water', 0, 'Suikoden1', 'Anji was an infamous pirate in the area of the Toran Lake for many years along with his close friends Kanak and Leonardo. Anji also has a history with Tai ho and his brother Yam Koo and after being visited by the Liberation Army Leader along with his old friends Anji decides to join the fight against the Scarlet Moon Empire. After the War Anji decides to give up being a pirate and goes into business with his two friends Kanak and Leonardo. ', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4957, 'Suiko Gaspar', 7, 4, 8, 4, 8, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4958, 'Novice Hix', 7, 7, 7, 8, 2, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 525, 35, 315, NULL),
