(4960, 'Tesla', 7, 3, 7, 7, 7, 'none', 0, 'Suikoden1', '', 1, 0, 0, NULL, 525, 35, 315, NULL),
(4961, 'Zorak', 6, 2, 8, 2, 8, 'none', 0, 'Suikoden1', 'Zorak is the leader of the Warriors Village who is infamous for telling long (and often boring) stories. Zoraks daughter was taken by the Vampire Neclord to be made into his next bride. Fortunately she was rescued by a young warrior Hix along with the help of Tir Mcdohl and Viktor who had held a grudge against Neclord for many years. After the incident Zorak agreed that Warriors Village would lend the Liberation Army its aid.', 1, 0, 0, NULL, 450, 30, 270, NULL),
