(5883, 'Groudon', 10, 10, 9, 7, 2, 'earth', 0, 'Hoenn', 'Groudon is known as the Continent Pokemon which according to mythology, created and expanded the lands throughout the Pokemon world. He rivals Sapphire Versions Legendary Water Pokemon, Kyogre. Groudon is Ground Type, he can make water evaporate with heat and light. Groudon still sleeps in Origin Cave after the epic battle with Kyogre.', 3, 0, 0, NULL, 750, 50, 450, NULL),
