(5894, 'PokeBlocks', 10, 8, 3, 10, 9, 'none', 1, 'Hoenn', 'Pokeblocks are squared candy that comes in various colors. Pokeblocks are made from mixing berries in a  Berry Blender. They are used by Contest Entrants to raise their Pokemons Conditions. The Hoenn Safari Zone also allows the use of Pokeblocks to find specific natured Pokemon and also distract Safari Pokemon while you attempt to catch them. If none of those purposes caught your eye, the best reason of all is to get with your friends to swap & blend berries, you never know what you will get.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(5895, 'PokeNav', 10, 10, 4, 9, 7, 'mechanical', 1, 'Hoenn', 'PokeNav, Short for Pokemon Navigator, created by the Devon Corporation. It has multiple functions, most popular being the Map, which shows the whole of the Hoenn Region and pinpoints the location of the owner. It can show the Pokemons Feelings and Emotions as well as Conditions, it also can show your Ribbons, which is useful for Contests. A favored function is the Trainers Eyes, it allows you to store 69 Trainers names into your PokeNav and go back for a rematch.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(5896, 'Team Aqua', 10, 9, 1, 10, 7, 'water', 1, 'Hoenn', 'Team Aqua rival Team Magma. Team Aquas Goals are to capture the Water Legendary Pokemon, Kyogre. Kyogre has the ability to raise the oceans, allowing Water Pokemon to benefit. Archie leads Team Aqua through their villainous plans and have two Admins who help, by the name of Matt and Shelly. Team Aqua can be found hiding out in Lilycove City on Sapphire Version. Team Aqua and Team Magma both agree on peace after they realize they had made Groudon and Kyogre fight.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
(5897, 'Team Magma', 10, 1, 10, 7, 9, 'fire', 1, 'Hoenn', 'A team rivaling Team Aqua. Team Magmas plans to awaken the Legendary Pokemon Groudon. By awakening Groudon, he will have the ability to lower the sea level creating more habitual land for Pokemon, which is Team Magmas goal. Team Magmas Leader is named Maxie and both Admins names are Courtney and Tabitha. In Ruby Version Team Magma reside in Lilycove City. Both Team Magma and Team Aqua come to realize what they are both doing is wrong and make peace.', 4, 0, 0, NULL, 1000, 50, 450, NULL),
