--
-- Table structure for table `cards`
--

CREATE TABLE `cards` (
  `id` int(10) UNSIGNED NOT NULL,
  `cardname` varchar(50) NOT NULL,
  `level` tinyint(3) UNSIGNED DEFAULT NULL,
  `left` tinyint(3) UNSIGNED DEFAULT NULL,
  `right` tinyint(3) UNSIGNED DEFAULT NULL,
  `up` tinyint(3) UNSIGNED DEFAULT NULL,
  `down` tinyint(3) UNSIGNED DEFAULT NULL,
  `element` varchar(15) DEFAULT NULL,
  `flggold` tinyint(3) UNSIGNED DEFAULT NULL,
  `deck` varchar(20) DEFAULT NULL,
  `Lore` varchar(500) NOT NULL,
  `TokenCost` int(10) UNSIGNED NOT NULL,
  `NoTrade` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `NoShop` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `CardMetaKeywords` varchar(250) DEFAULT NULL,
  `Crystals` int(11) DEFAULT 0,
  `Vendor` int(11) DEFAULT 0,
  `Transmute` int(11) DEFAULT 0,
  `CardInfo` varchar(300) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci ROW_FORMAT=COMPACT;

